window.bookSummaryJSON = "<p>With Kingsley safe and Momar subdued for the moment, it's time for healing. Jessie and the gang take a much-needed break.</p> <p>Or, at least, the gang does. The holidays are upon them and the ex has invited Jessie to meet his new fiancée. It's off to L.A. where Jessie will face her past and the wounds she didn't realize still lingered.</p> <p>Niamh, too, meets a blast from her past. This one, though, is ten times more dangerous. Re-connecting is a risk not even Tristan is sure they should take.</p> <p>All the while, Nessa and Sebastian are not far away, ready to unleash a surprise the crew could never expect.</p> <p>The journey continues in this next installment of the multiple-time Wall Street Journal and International Bestselling Series.</p>"; 
